History, War Documentary hosted by Warwick Davis, published by Smithsonian Channel in 2014 - English narration


Information
------------------------------

The Seven Dwarfs of Auschwitz
They were a family of seven Jewish dwarfs living under Nazi rule. What happened when they were discovered reaches beyond the imaginings of even the darkest fairy tale. Join actor Warwick Davis as he tells the story of the Ovitz family, a troupe of seven performers who became prisoners and, eventually, guinea pigs to the Nazi's &quot;Angel of Death&quot; Dr. Josef Mengele. Warwick's expedition takes us to Eastern Europe and explores their remarkable, inspirational story of human endurance.

